const DEFAULT_TASKS = [
  {
    name: "Go to gym",
    priority: 3,
    status: "To Do",
  },
  {
    name: "Read a book",
    priority: 1,
    status: "Done",
  },
  {
    name: "Go to market",
    priority: 2,
    status: "In Progress",
  },
  {
    name: "Restart Learning Solidworks",
    priority: 3,
    status: "To Do",
  },
  {
    name: "change slider to scroll",
    priority: {
      priorityText: "High",
      priorityColor: "ActiveHigh",
    },
    status: "Done",
    progress: 0,
  },
  {
    name: "To publish the article",
    priority: {
      priorityText: "Medium",
      priorityColor: "ActiveMedium",
    },
    status: "In progress",
    progress: 0,
  },
];

export default DEFAULT_TASKS;
